import React from 'react';
import styled from 'styled-components';

const AlarmListBlock = styled.div`
  width: 512px;
  height: 768px;

  position: relative; /* 추후 박스 하단에 추가 버튼을 위치시키기 위한 설정 */
  background: white;
  border-radius: 16px;
  box-shadow: 0 0 8px 0 rgba(0, 0, 0, 0.04);

  margin: 0 auto; /* 페이지 중앙에 나타나도록 설정 */

  margin-top: 96px;
  margin-bottom: 32px;
  display: flex;
  flex-direction: column;
`;

function TodoTemplate({ children }) {
  return <TodoTemplateBlock>{children}</TodoTemplateBlock>;
}


function Product({ product }) {
  return (
    <div>
      <b>{product.releasedate}</b> <span>({product.productname})</span>
    </div>
  );
}

function AlarmList() {
  const products = [
    {
      id: 1,
      releasedate: '20211229',
      productname: '나이키 조던 1 레트로 하이 OG'
    },

    {
      id: 2,
      releasedate: '20211230',        
      productname: '아디다스 이지 부스트'
    },

    {
      id: 2,
      releasedate: '20211231',        
      productname: '뉴발란스 993'
    },
  ];

  return (
    <div>
      {products.map(product => (
        <Product product={product} key={product.id} />
      ))}
    </div>
  );
}


export default AlarmList;
